import * as React from 'react';
import { shallow, configure } from 'enzyme';
import { shallowToJson } from 'enzyme-to-json';
import * as Adapter from 'enzyme-adapter-react-16';
import Image from '../Image';
import maskSymbols from "@/components/base/utils/maskSymbols";

configure({adapter: new Adapter()});
describe('Testing component Image', () => {

    it('should not be img', () => {
        const output = shallow(
            <Image width='90' height='101' src='' />
        );
        expect(/<img/.test(JSON.stringify(shallowToJson(output)))).toEqual(false);
    })

    it('should be div', () => {
        const output = shallow(
            <Image width='90' height='101' src='' />
        );
        expect(/div/.test(JSON.stringify(shallowToJson(output)))).toEqual(true);
    })

    it('should have not attribute class equal img', () => {
        const output = shallow(
            <Image width='90' height='101' src='' />
        );
        expect(/class="img"/.test(JSON.stringify(shallowToJson(output)))).toEqual(false);
    })

    it('should have not attribute style', () => {
        const output = shallow(
            <Image width='90' height='101' src='' />
        );
        expect(/style=/.test(JSON.stringify(shallowToJson(output)))).toEqual(false);
    })

    it('should render correctly div with class and picture 90x101', () => {
        const output = shallow(
            <Image width='90' height='101' src='data:image/webp;base64,' />
        );
        expect(shallowToJson(output)).toMatchSnapshot();
    });

    it('should render correctly div with class and picture 90x90', () => {
        const output = shallow(
            <Image width='90' height='90' src='data:image/webp;base64,' />
        );
        expect(shallowToJson(output)).toMatchSnapshot();
    });

    it('should render correctly div with class and picture 1000x1000', () => {
        const output = shallow(
            <Image width='4000' height='1383' src='data:image/png;base64,' />
        );
        expect(shallowToJson(output)).toMatchSnapshot();
    });

    it('should render correctly div with class without picture 100x200', () => {
        const output = shallow(
            <Image width='100' height='200' src='' />
        );
        expect(shallowToJson(output)).toMatchSnapshot();
    });

    it('should render correctly div with class without width with picture', () => {
        const output = shallow(
            <Image width='' height='200' src='data:image/webp;base64,' />
        );
        expect(shallowToJson(output)).toMatchSnapshot();
    });
});

describe('Image', () => {
    it('should render correctly div with class without width with picture with negative height', () => {
        const output = shallow(
            <Image width='' height='-200' src='data:image/webp;base64,' />
        );
        expect(shallowToJson(output)).toMatchSnapshot();
    });

    it('should render correctly div with class without params', () => {
        const output = shallow(
            <Image width='' height='' src='' />
        );
        expect(shallowToJson(output)).toMatchSnapshot();
    });
});
